import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <header>
            <div className="logo">LOGO</div>
            <nav>
                <Link to="/">Inicio</Link>
                <Link to="/cart">Carrito</Link>
                <Link to="/products">Productos</Link>
            </nav>
        </header>
    );
}

export default Header;
